import React, { useRef, useState } from 'react';
import '../assets/styles/Contact.scss';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import SendIcon from '@mui/icons-material/Send';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';

function Contact() {

  const [name, setName] = useState<string>('');
  const [email, setEmail] = useState<string>('');
  const [message, setMessage] = useState<string>('');

  const [nameError, setNameError] = useState<boolean>(false);
  const [emailError, setEmailError] = useState<boolean>(false);
  const [messageError, setMessageError] = useState<boolean>(false);

  const form = useRef<HTMLFormElement>(null);

  const sendEmail = (e: any) => {
    e.preventDefault();

    setNameError(name === '');
    setEmailError(email === '');
    setMessageError(message === '');

    /* Uncomment below if you want to enable the emailJS */

    // if (name !== '' && email !== '' && message !== '') {
    //   var templateParams = {
    //     name: name,
    //     email: email,
    //     message: message
    //   };

    //   console.log(templateParams);
    //   emailjs.send('service_id', 'template_id', templateParams, 'api_key').then(
    //     (response) => {
    //       console.log('SUCCESS!', response.status, response.text);
    //     },
    //     (error) => {
    //       console.log('FAILED...', error);
    //     },
    //   );
    //   setName('');
    //   setEmail('');
    //   setMessage('');
    // }
  };

  return (
    <section id="contact">
      <Box className="contact-minimal" sx={{ maxWidth: 420, mx: 'auto', my: 8, p: 0 }}>
        <Typography variant="h6" align="center" fontWeight={500} sx={{ mb: 1, letterSpacing: 0.5 }}>
          Contact Me
        </Typography>
        <Typography variant="body2" align="center" color="text.secondary" sx={{ mb: 3, fontSize: '1rem' }}>
          Interested in collaborating on Flutter projects, competitive programming, or research opportunities? Let's connect!
        </Typography>
        <Box className="contact-info-minimal" sx={{ display: 'flex', justifyContent: 'center', gap: 3, mb: 3 }}>
          <Typography variant="body2" color="text.secondary" sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
            <SendIcon fontSize="small" sx={{ opacity: 0.6 }} />
            <span>kabyasaha1812@gmail.com</span>
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
            <span role="img" aria-label="phone" style={{ opacity: 0.6 }}>📞</span>
            <span>+8801303359281</span>
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
            <span role="img" aria-label="location" style={{ opacity: 0.6 }}>📍</span>
            <span>Dhaka</span>
          </Typography>
        </Box>
        <form ref={form} onSubmit={sendEmail} autoComplete="off">
          <TextField
            label="Name"
            variant="standard"
            size="small"
            fullWidth
            value={name}
            onChange={e => setName(e.target.value)}
            error={nameError}
            sx={{ mb: 1.5 }}
            InputProps={{ disableUnderline: false }}
          />
          <TextField
            label="Email"
            variant="standard"
            size="small"
            fullWidth
            value={email}
            onChange={e => setEmail(e.target.value)}
            error={emailError}
            sx={{ mb: 1.5 }}
            InputProps={{ disableUnderline: false }}
          />
          <TextField
            label="Message"
            variant="standard"
            size="small"
            fullWidth
            multiline
            minRows={3}
            value={message}
            onChange={e => setMessage(e.target.value)}
            error={messageError}
            sx={{ mb: 2 }}
            InputProps={{ disableUnderline: false }}
          />
          <Button
            type="submit"
            variant="contained"
            endIcon={<SendIcon />}
            fullWidth
            sx={{ borderRadius: 2, textTransform: 'none', fontWeight: 500, bgcolor: '#222', ':hover': { bgcolor: '#444' } }}
          >
            Send
          </Button>
        </form>
      </Box>
    </section>
  );
}

export default Contact;
